var $bm_rt;
var amp, freq, decay, n, t, v;
amp = 0.1;
freq = 1.5;
decay = 3;
$bm_rt = n = numKeys;
if (n == 0) {
    $bm_rt = value;
} else {
    $bm_rt = t = sub(time, key(n).time);
    if (t > 0) {
        v = velocityAtTime(sub(key(n).time, div(thisComp.frameDuration, 10)));
        $bm_rt = sum(value, div(mul(mul(v, amp), Math.sin(mul(mul(mul(freq, 2), Math.PI), t))), Math.exp(mul(decay, t))));
    } else {
        $bm_rt = value;
    }
    ;
}

